import React from 'react';

import './home.css';
import { PHButton } from '@ui/common/element/page/muButton';
import { ListRowInputType, ListRowButtonType, ListRow } from '@ui/common/element/page/muListRow';

import { HomeIndexSection } from './home_section';

const GlowHome = () => {
  return <div>
    <div className='homePageIndicator' />
    <div className='homePageContainer'>
      <HomeIndexSection />
    </div>
  </div>
};

export {
  GlowHome
};
